const Home = () => {
    return ( 
        <body>
            <section className="myHeader">Header</section>
            <section className="myLogo">Logo</section>
            <section className="myCategory">Category</section>
            <section className="myUpperSection">Upper Section</section>
            <section className="myLowerSection">Lower Section</section>
            <section className="myFooter">Footer</section>
        </body>
     );
}

export default Home;
